var utils = require('./utils.js');

function createRm(client) {
  async function rm({timeout, signal, headers, ...query}) {
    await client.post('pin/remote/rm', {
      timeout,
      signal,
      headers,
      searchParams: utils.encodeQuery({
        ...query,
        all: false
      })
    });
  }
  return rm;
}

